    public final static void setSquareAttackDirectionSquareDestinationAttackLine() {
        try {

            BufferedReader in = new BufferedReader(new FileReader("SwClPiranha/src/game/data.txt"));
            String[] arr = in.readLine().split(" ");
            //System.out.println(arr.length);
            int counter = 0;
            for (int i = 0; i < 100; i++) {
                BitBoard[][] array = new BitBoard[8][8];
                for (int j = 0; j < 8; j++) {
                    BitBoard[] arrayJ = new BitBoard[8];
                    for (int k = 0; k < 8; k++) {
                        BitBoard b;
                        long l0 = Long.parseLong(arr[counter]);
                        long l1 = Long.parseLong(arr[counter + 1]);
                        counter += 2;
                        b = new BitBoard(l0, l1);
                        arrayJ[k] = b;
                    }
                    array[j] = arrayJ;
                }
                SQUARE_ATTACK_DIRECTION_SQUARE_DESTINATION_ATTACK_LINE[i] = array;
            }


        } catch (Exception e) {
            e.printStackTrace();
        }
    }
